import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import "semantic-ui-css/semantic.min."

ReactDOM.render(
  <React.StrictMode>
    <div>
      <Button primary>Primary</Button>
      <Button secondary>Secondary</Button>
    </div>
  </React.StrictMode>,
  document.getElementById("root")
);
